import React from 'react';
import { useNavigate } from 'react-router-dom';
import Login from './Login';

const AuthPage = () => {
  const navigate = useNavigate();

  return (
    <div
      style={{
        minHeight: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        padding: '3rem 1.5rem',
        backgroundColor: '#0f0f17',
        backgroundImage: 'radial-gradient(circle at center, #7f00ff, #0f0f17 70%)',
        fontFamily: "'Orbitron', 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
        color: '#eee',
      }}
    >
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          gap: '3rem',
          backgroundColor: '#1a1a2e',
          borderRadius: '24px',
          boxShadow: '0 0 30px #7f00ff, 0 0 60px #b433ff',
          padding: '3rem 4rem',
          maxWidth: '860px',
          width: '100%',
          flexWrap: 'wrap',
          justifyContent: 'center',
          alignItems: 'stretch',
          border: '1px solid #7f00ff',
        }}
      >
        {/* Login Card */}
        <div
          style={{
            flex: '1 1 440px',
            backgroundColor: '#12122a',
            padding: '3rem 3rem 2.5rem',
            borderRadius: '18px',
            boxShadow: '0 0 20px #b433ff, inset 0 0 10px #7f00ff',
            display: 'flex',
            flexDirection: 'column',
            border: '1px solid #b433ff',
            color: '#ddd',
          }}
        >
          <h2
            style={{
              color: '#d4b3ff',
              fontWeight: '900',
              fontSize: '2.6rem',
              letterSpacing: '0.1em',
              marginBottom: '2rem',
              textAlign: 'center',
              textShadow: '0 0 8px #b433ff',
              userSelect: 'none',
              fontFamily: "'Orbitron', sans-serif",
            }}
          >
            WELCOME BACK
          </h2>
          <Login />
        </div>

        {/* Register Card */}
        <div
          role="button"
          tabIndex={0}
          onClick={() => navigate('/register')}
          onKeyDown={(e) => {
            if (e.key === 'Enter') navigate('/register');
          }}
          style={{
            flex: '0 0 280px',
            background:
              'linear-gradient(135deg, #b433ff 0%, #7f00ff 40%, #b433ff 80%)',
            borderRadius: '20px',
            boxShadow:
              '0 0 15px #b433ff, 0 0 40px #7f00ff, inset 0 0 20px #d0a0ff',
            color: '#eee',
            cursor: 'pointer',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            alignItems: 'center',
            padding: '3rem 2.5rem',
            userSelect: 'none',
            transition: 'transform 0.25s ease, box-shadow 0.25s ease',
            border: '1px solid #d0a0ff',
          }}
          onMouseEnter={(e) => {
            e.currentTarget.style.transform = 'scale(1.07)';
            e.currentTarget.style.boxShadow =
              '0 0 25px #d464ff, 0 0 70px #a743ff, inset 0 0 30px #e7b1ff';
          }}
          onMouseLeave={(e) => {
            e.currentTarget.style.transform = 'scale(1)';
            e.currentTarget.style.boxShadow =
              '0 0 15px #b433ff, 0 0 40px #7f00ff, inset 0 0 20px #d0a0ff';
          }}
        >
          <h3
            style={{
              fontWeight: '900',
              fontSize: '2.2rem',
              marginBottom: '2.5rem',
              userSelect: 'none',
              letterSpacing: '0.12em',
              fontFamily: "'Orbitron', sans-serif",
              textShadow: '0 0 10px #f0e7ff',
            }}
          >
            NEW HERE?
          </h3>
          <button
            onClick={(e) => {
              e.stopPropagation();
              navigate('/register');
            }}
            onKeyDown={(e) => e.stopPropagation()}
            style={{
              display: 'flex',
              alignItems: 'center',
              gap: '1rem',
              backgroundColor: 'rgba(255,255,255,0.15)',
              color: '#f3e8ff',
              border: '1.5px solid #f3e8ff',
              borderRadius: '16px',
              padding: '1rem 3rem',
              fontSize: '1.3rem',
              fontWeight: '900',
              cursor: 'pointer',
              boxShadow: '0 0 10px #c987ff',
              transition: 'background-color 0.3s ease, box-shadow 0.3s ease',
              fontFamily: "'Orbitron', sans-serif",
              userSelect: 'none',
              textShadow: '0 0 4px #b076ff',
            }}
            onMouseEnter={(e) => {
              e.currentTarget.style.backgroundColor = 'rgba(255,255,255,0.3)';
              e.currentTarget.style.boxShadow = '0 0 25px #e0a8ff';
            }}
            onMouseLeave={(e) => {
              e.currentTarget.style.backgroundColor = 'rgba(255,255,255,0.15)';
              e.currentTarget.style.boxShadow = '0 0 10px #c987ff';
            }}
          >
            Register
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              fill="none"
              stroke="#f3e8ff"
              strokeWidth="3"
              strokeLinecap="round"
              strokeLinejoin="round"
              viewBox="0 0 24 24"
              aria-hidden="true"
              focusable="false"
            >
              <line x1="5" y1="12" x2="19" y2="12" />
              <polyline points="12 5 19 12 12 19" />
            </svg>
          </button>
        </div>
      </div>
    </div>
  );
};

export default AuthPage;
